static int module_id_get(const char *name)
{
	u32_t modules_cnt = log_sources_count();
	const char *tmp_name;
	u32_t i;

	for (i = 0U; i < modules_cnt; i++) {
		tmp_name = log_source_name_get(CONFIG_LOG_DOMAIN_ID, i);

		if (strncmp(tmp_name, name, 64) == 0) {
			return i;
		}
	}
	return -1;
}
